son，一个性格直率、固执己见的老人。只要身边有人，他就会不由自主地发表自己对时事的看法。他的话题非常广泛。在一段时间里，他几乎成了「针砭时弊」的代名词。 没有人能「逃脱」Ed的「折磨」－－包括他的儿子Henry（Ryan Delvin扮演）和Vince（Will Sasso扮演）。Henry是一个不太成功的作家，现在是自由博客撰写人。Vince比他的兄弟要谦和得多，和妻子Kathleen（Nicole Sullivan扮演）一起开了一家夫妻房地产公司。Kathleen是个很厉害的女人，Vince只有当「妻管严」的份。 Henry频临破产，已经没法向漂亮的室友Sam（Stephanie Lemelin扮演）付房租了。当然，不用说你也知道，Henry一直暗恋着Sam。看到儿子惨兮兮的样子，Ed放下架子，邀请他搬回家中居住。尽管Henry知道自己耳根子再也无法清净，但还是同意了。 这对父子的关系很难用言语来描述。不过，Ed总是能说上两句让人很受用的话，这对Henry来说已经足够了。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1367:"第01集$http://yanzishan.shuhu-zuida.com/20190814/8822_be760b27/index.m3u8#第02集$http://yanzishan.shuhu-zuida.com/20190814/8821_24ecb1f0/index.m3u8#第03集$http://yanzishan.shuhu-zuida.com/20190814/8820_df3de43d/index.m3u8#第04集$http://yanzishan.shuhu-zuida.com/20190814/8819_56189cb8/index.m3u8#第05集$http://yanzishan.shuhu-zuida.com/20190814/8818_bc51fa5a/index.m3u8#第06集$http://yanzishan.shuhu-zuida.com/20190814/8817_5646aaca/index.m3u8#第07集$http://yanzishan.shuhu-zuida.com/20190814/8816_1746caa2/index.m3u8#第08集$http://yanzishan.shuhu-zuida.com/20190814/8815_831dbd82/index.m3u8#第09集$http://yanzishan.shuhu-zuida.com/20190814/8814_d0d7962d/index.m3u8#第10集$http://yanzishan.shuhu-zuida.com/20190814/8813_342a8a6c/index.m3u8#第11集$http://yanzishan.shuhu-zuida.com/20190814/8812_b4564b63/index.m3u8#第12集$http://yanzishan.shuhu-zuida.com/20190814/8811_a2ca5ded/index.m3u8#第13集$http://yanzishan.shuhu-zuida.com/20190814/8810_56edb62d/index.m3u8#第14集$http://yanzishan.shuhu-zuida.com/20190814/8809_3738f869/index.m3u8#第15集$http://yanzishan.shuhu-zuida.com/20190814/8808_0e9a60c3/index.m3u8#第16集$http://yanzishan.shuhu-zuida.com/20190814/8807_afd7b867/index.m3u8#第17集$http://yanzishan.shuhu-zuida.com/20190814/8806_cc8a5f94/index.m3u8#第18集$http://yanzishan.shuhu-zuida.com/20190814/8805_deca7a93/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s